// import Header from './components/Header';
import Home from './components/Home';
import About from './components/About';
import {Link} from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';

import './App.css';

function App() {
  return (
    <div className="App">
      {/* {<Home/>} */}
      {/* {<About />} */}
      {/* {<Portfolio />} */}
      {/* {<Resume />} */}
    <Link to="/">
      About
    </Link>
    <Link to="/">
      Portfolio
    </Link>
    <Link to="/">
      Resume
    </Link>
    <Link to="/contact">
      Contact
    </Link>
    </div>
  );
}

export default App;
